create table Room (
                      roomID INT,
                      room_type VARCHAR(30),
                      bed_type VARCHAR(30),
                      floor_number INT,
                      cost_per_day INT,
                      discount INT,
                      special_offer VARCHAR(30) null,
                      reservationID INT null,
                      hotelID INT,
                      primary key(roomID),
                      foreign key(reservationID) references reservation(reservationID),
                      foreign key(hotelID) references hotel(hotelID)
);

